import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Home from "./pages/Home";
import WageReport from "./pages/WageReport";
import LeafletMap from './pages/LeafletMap';
import HomePage from './pages/HomePage';
import AboutPage from './pages/AboutPage';
import ContactPage from './pages/ContactPage';
import DefiningProblemPage from './pages/DefiningTheProblem';


function App() {
  return (
    <Router>
      {/* <nav>
        <Link to="/">Home</Link> |{" "}
        <Link to="/wage-report">Wage Report</Link>
      </nav> */}
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/wage-report" element={<WageReport />} />
          <Route path="/map" element={<LeafletMap />} />
          <Route path="/about" element={<AboutPage />} />
          <Route path="/contact" element={<ContactPage />} />
          <Route path="/defining-the-problem" element={<DefiningTheProblem />} />
          <Route path="/solutions" element={<SolutionsPage />} />
        </Routes>

    </Router>
  );
}

export default App;
